assert solution(stdin) == '-1'

-----Constraints-----

1 <= n <= 10^5

-----Time Limit-----

O(n)


-----Submissions-----

Approach:

Use a dictionary to store the permutations of length n.

For each permutation, check if it is a valid permutation triple.

If it is not, return -1.

If it is, return the triple.

Time complexity: O(n^2)

Space complexity: O(n)

"""

class Solution:
    def luckyNumbers(self, n: int) -> str:

        d = {}

        for i in range(1, n+1):
            d[i] = 0

        for i in range(1, n+1):
            for j in range(1, n+1):
                if i + j == n:
                    d[i] += 1

        for i in range(1, n+1):
            if d[i] == 0:
                return str(i)

        return -1
